import React from 'react';
import { connect} from 'react-redux';
import { fetchLatest } from '../redux/action';
import { useEffect } from 'react';
import { useSelector } from 'react-redux';
const Popular = (props) => {

    const popular = useSelector((state)=> state.trending.data.results)
    const loading = useSelector((state)=>state.trending.loading)

  useEffect(()=>{

    props.fetchLatest()

  },[])

return (loading===true ? (<h1>...loading</h1>) :    (



  <div>

      {popular.map((data)=>{

          const {poster_path, name,}  = data

          return (
                  <div>
                      <img src={`https://image.tmdb.org/t/p/w500${poster_path}`} alt="" />


                  </div>

          )

      })}








  </div>










)  )






}

export default connect(null, {fetchLatest})(Popular);
